import { useDispatch } from "react-redux";

import { setLoading } from "@redux";
import { useEffect, useState } from "react";
import { historyApi } from "@api";
import { IBenefit, ICoupon, IReward } from "@interfaces";
import { enumTypes } from "@configs";

export const ModuleHistory = () => {
    //page hooks
    const dispatch = useDispatch();
    //page state
    const [histories, setHistories] = useState<(IBenefit | IReward | ICoupon)[]>();
    useEffect(() => {
        (async () => {
            dispatch(setLoading(true));
            const res = await historyApi.getListHistory();
            const data = res.data.docs.map((item) => {
                if (item.type === enumTypes.REWARD) {
                    return item.reward;
                }
            }) as (IBenefit | IReward | ICoupon)[];
            console.log(res.data.docs);
            setHistories(data);
            dispatch(setLoading(false));
        })();
    }, []);
    return <></>;
};
